            "690330102": {
                "Next": [
                    690330103
                ],
                "Type": 1,
                "Text": "我又变强了不少哦，要来切磋一下吗？"
            },
            "690330103": {
                "Next": [],
                "Type": 1,
                "Text": "…开玩笑的。嗯，来找我是有话想说吧。"
            },
            "690335101": {
                "Next": [
                    690335102
                ],
                "Type": 1,
                "Text": "浓郁的香气，真是让人心情畅快。"
            },
            "690335102": {
                "Next": [
                    690335103
                ],
                "Type": 1,
                "Text": "之前我尝过「琉璃亭」、「新月轩」的菜肴，但异国美食，只去华贵酒家肯定也领略不全。"
            },
            "690335103": {
                "Next": [],
                "Type": 1,
                "Text": "带我尝尝当地特色小吃的工作，就交给你了哦？"
            }
